// 只有在服务端被渲染时才会被执行
class MyDocument extends Document {
    render(){
        <Html>
            <Head>
                {/* <title>MyApp</title> */}
            </Head>
            <body>
                <Main></Main>
                <NextScript></NextScript>
            </body>
        </Html>
    }
}

export default MyDocument
